comment:
성아는 뭔 랜챗상대가 누군지도 모르는데 또 만나러 가나..; 
게다가 그 첫컷 여자는 도대체 누구인 것인가 저번화 베댓은 이태양 여동생일거라고 했는데 그러면 얘라고 할리가 없음..
뭔가 중학교때 그 여자애는 준우를 알지만 준우는 그 여자애를 알지 못하니..흥미진징

태양아 진술서를 낸 거는 그 돼지인데 왜 준우한테 그러는 거니?
돼지가 구라친거 딱 봐도 티 나는 데?
진술을 그 돼지가 했으면 돼지가  널 누명 씌운거지 왜 준우한테 그러니?;;

근데 누가봐도 저런 상황에 구라치면 태양이도 오해할 수밖에 없었겠다..
근데 저렇게 너무 막나가니까 태양이는 그래도 싫음ㅋ
근데어찌보면 태양이도 ㅈㄴ 불쌍하네 짱친준우잃고;;
